import React from "react";
import styled from "styled-components";

const Header: React.FC = () => {
  return (
    <Container>
      <Logo>DEFY THE CURRENT™</Logo>

      <Title>HELLO</Title>

      <Hamburger>
        <Ohamburger>
          <LineH />
          <WordM>
            <A>M</A>
          </WordM>
          <WordE>
            <A>E</A>
          </WordE>
          <WordN>
            <A>N</A>
          </WordN>
          <WordU>
            <A>U</A>
          </WordU>
          <LineV />
        </Ohamburger>
      </Hamburger>

      <Util>
        <span>DEFY THE CURRENT™</span>
      </Util>
    </Container>
  );
};

const Container = styled.div``;

const Logo = styled.a``;

const Title = styled.p``;

const Hamburger = styled.div``;

const Ohamburger = styled.a``;

const A = styled.span``;

const LineH = styled.span``;

const WordM = styled.span``;

const WordE = styled.span``;

const WordN = styled.span``;

const WordU = styled.span``;

const LineV = styled.span``;

const Util = styled.div``;

export default Header;
